import React,{Component} from 'react';

class App extends Component{
    constructor(props){
        super(props);
        this.state = {};
    }

    render(){
        return(
            <div className="row">
            <img src="minion.jpg"></img>
                <p className="col-sm-8">Bonjour</p>
                <p className="col-sm-4">Bonjour</p>
            </div>
        );
    }
}

export default App;
